export const Navbar = () => {
  return (
    <div className='navbar-div'>
      <a href='#intro'>Home</a>
      <a href='#intro'>Hobbies</a>
      <a href='#intro'>Youtube</a>
      <a href='#intro'>Contact</a>
    </div>
  )
}
